import React from 'react';
import './App.css';

function App() {
  return (
    <div className="dashboard">
      <h1>Nkanyezi Lamp Admin Dashboard</h1>
      <p>Welcome! The backend is running. Upload PDFs and manage workflow here.</p>
    </div>
  );
}

export default App;
